import React ,{useState,useContext} from 'react'
import {Link} from "react-router-dom"
import LoginNavBar from '../logincomponents/LoginNavBar'
import {FcHome} from "react-icons/fc"
import DateRange from '../components/DateRange'
import Hero from '../components/Hero'
import Title from '../components/Title'
import '../App.css'
import Banner from '../components/Banner'
import GoogleLogin from 'react-google-login'


import { RoomContext } from '../context';


const BookedProperties = () => { 

    const context = useContext(RoomContext)

    const{
        type,
        rooms,
        capacity,
        price,
        minPrice,
        maxPrice,
        place,
        // breakfast,
        // pets
    } = context

    console.log(context);
    console.log(place);
    console.log(rooms.extras);
    return (
        <div>
            <LoginNavBar/>
            <Hero>
                <Title title="We are booking your property.... "></Title>
                <Banner>
                <h6>Meanwhile select dates for your stay:</h6>
                <DateRange/>
                </Banner>
                {/* <section className="dates">
                {/* <div className="services-center"> */}
                    {/* <article className = "dates">
                    
                <DateRange/>
                    </article> */}
                {/* </div> */}
                {/* </section> */} 
            </Hero>           
             
            <h6>Login to checkout</h6>           

            <Link to='/Login' className="btn-primary">Login</Link>     
            <GoogleLogin
            clientId={process.env.REACT_APP_GOOGLE_CLIENT_ID}
                buttonText="Log in with Google"
                // onSuccess={handleLogin}
                // onFailure={handleLogin}
                cookiePolicy={'single_host_origin'}
            />       
            
        </div>


    )
}

export default BookedProperties

